window.bookSummaryJSON = "<p><b>Death is only the beginning. </b> </p> <p>When an attack lands me in the spirit world, I’m determined to get back to my life and my lovers. My only solace in the strange place is my mother, who has the answers to questions I never got to ask in her lifetime. And though I long for the pieces to the puzzle of her death and my life, the most important question of all is.... How do I get out of here? </p> <p>I must act fast. If I stay here too long, I won’t be able to return to the world of the living at all. Before I leave, though, I find out devastating truths about who I am - and who I’m not. My world is shaken by the revelations, not the least of which is finding out who hates me enough to want me dead in the first place. </p> <p>As I fight to escape the spirit world before my time runs out, I realize another horrible truth. In order to return to the land of the living, one of my mates must love me enough to sacrifice himself to bring me back. </p> <p>But escaping the spirit world plunges me into even greater danger. This time, not only my life hangs in the balance. This time, I’ll lose my heart as well. </p> <p><i>Perfect for 18+ listeners who love: </i> </p> <ul> <li>HOT reverse harem/whychoose romance </li> <li>Dark romance with triggers and taboo themes </li> <li>Badass princesses with big hearts </li> <li>A plot full of twists and turns, quests, and political intrigue </li> <li>panty-melting steamy scenes </li> <li>scheming royals </li> <li>sexy big cat shifters </li> <li>fated mates and mating frenzy</li> </ul>"; 
